                      <p>
                        Due to the increased efficiency and productivity
                        tractors brought, farms became larger because farmers
                        could now handle more land. The advent of the tractor
                        also allowed for specialization in crops and livestock,
                        which shifted the farm economy to a cash-crop model and
                        reduced the self-sufficiency of the farm.
                      </p>
